import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";
import style from "./landing.module.css";

function Landing() {
  const navigate = useNavigate();
  const videogames = useSelector((state) => state.videogames);
  console.log(videogames);

  const handleClick = () => {
    navigate("home");
  };

  return (
    <div className={style.landing}>
      <div>
        <p className={style.text}>Welocome to...</p>
        <h1 className={style.name} >KaypaGames</h1>
        <p className={style.text}>The geatest place where you can find, create and edit all your favorites videogames.</p>
        <p className={style.text}>Let's take a look and have fun!</p>
        <button  className={style.button} onClick={handleClick}>Explore</button>
      </div>
      
    </div>
  );
}

export default Landing;
